import { combineReducers } from 'redux';

import GlobalState from './GlobalState';
import Invoices from './Invoices';
import Auth from '../components/Auth/Auth';

// eslint-disable-next-line

export default combineReducers({
  GlobalState,
  Invoices,
  Auth,
});
